 the Eastern Kingdoms is dominated by the Khaz Mountains and the Redridge Mountains. Both cover several zones.",maps={1463},["zone-text-continent"]=1,g={h(-12,{ach(42),ach(1676,{r=2}),ach(1677,{r=1,rwp=50004})}),m(1455,{icon=255138,isRaid=1,lore="Ironforge is the capital city of the dwarves, proud members of the Alliance. It is the ancestral home of the Bronzebeard dwarves. King Bronzebeard rules the kingdom of Khaz Modan from the throne room within the city. The Great Forge area gave the city its name.\n\nCarved into the stone heart of Khaz Modan, the mighty city of Ironforge is a testament to the dwarves' strength and resilience. The city is perhaps the most intricate of the Alliance cities, boasting many small passageways, shops built into the rock walls, and cavernous rooms. The feel of the city is a bustling, rowdy, and somewhat industrial one. However, it is predominantly safe-feeling and cozy; fires roar in the hearths of the inns and shops, and much dwarven laughing and frivolity is to be heard. Also, unlike Stormwind and Darnassus, the city is actually a massive cavern carved into the earth by the dwarves; the ceiling and floor are both hard stone.\n\nMainly because of the Deeprun Tram, linking Ironforge and Stormwind City, and the district of Tinker Town, Ironforge is one of the most racially diverse cities in the Alliance world. Dwarves predominate, of course, but you will find plenty of gnomes even outside of Tinker Town, and probably as many humans. You will find almost no night elves however, as they probably prefer more natural and open spaced environments.",g={h(-12,{ach(1837,{awp=20001,providers={{"i",34484}},requireSkill=356,u=17})}),h(-31,{faction(54,{icon=236446,OnTooltip=_.OnTooltipDB.RuneclothTurnIns,r=2}),faction(47,{icon=236444,OnTooltip=_.OnTooltipDB.RuneclothTurnIns,r=2})}),h(-32,{fp(6,{coords={{55.6,48,1455}},crs={1573},r=2})}),h(-44,{prof(164,{n(4258,{coords={{52.6,40.8,1455}},r=2}),n(5164,{coords={{50.2,42.6,1455}},r=2,g={r(9788,{learned