 moon rises.",g={h(-12,{ach(769,{crit(1292,{achID=42,id=1})})}),h(-30,{exp(233,{crit(1063,{achID=769,id=1})}),exp(231,{crit(1067,{achID=769,id=1})}),exp(213,{crit(1061,{achID=769,id=1})}),exp(172,{crit(1058,{achID=769,id=1})}),exp(238,{crit(1053,{achID=769,id=1})}),exp(928,{crit(1057,{achID=769,id=1})}),exp(229,{crit(1062,{achID=769,id=1})}),exp(204,{crit(1065,{achID=769,id=1})}),exp(236,{crit(1064,{achID=769,id=1})}),exp(232),exp(240,{crit(1055,{achID=769,id=1})}),exp(237,{crit(1059,{achID=769,id=1})}),exp(230,{crit(1066,{achID=769,id=1})}),exp(239),exp(228,{crit(1060,{achID=769,id=1})}),exp(927,{crit(1054,{achID=769,id=1})}),exp(226,{crit(1056,{achID=769,id=1})}),exp(227)}),h(-32,{fp(10,{coords={{45.6,42.6,1421}},crs={2226},r=1})}),h(-45,{q(530,{coords={{62,43,1458}},lvl=10,qgs={2050},r=1,rwp=40003,sourceQuests={441},g={qo(1,{coords={{46.4,84.6,1421}},crs={2332},providers={{"i",3613}},rwp=40003}),i(3235,{b=1,f=52,q=2,rwp=40003})}}),q(447,{coords={{43.4,40.8,1421}},lvl=9,qgs={1937},r=1,rwp=40003,g={qo(1,{crs={1778,1797,12432},providers={{"i",3253}},rwp=40003}),qo(2,{crs={1780,1781,12433},providers={{"i",3254}},rwp=40003}),i(3448,{f=55,q=1,rwp=40003})}}),q(450,{coords={{48.6,69.4,1458}},lvl=9,qgs={2055},r=1,rwp=40003,sourceQuests={447},g={qo(1,{coords={{43,73.3,1421}},providers={{"i",3255},{"o",1594}},rwp=40003})}}),q(451,{coords={{43.4,40.8,1421}},lvl=9,qgs={1937},r=1,rwp=40003,sourceQuests={450},g={qo(1,{crs={1953,1954},providers={{"i",3256}},rwp=40003}),qo(2,{crs={1955,1956},providers={{"i",3257}},rwp=40003}),qo(3,{crs={1767,1768,1908,1909,1957,1958},providers={{"i",3258}},rwp=40003}),s(118774,3451,{b=1,f=1,q=2,rwp=40003}),s(118882,3582,{b=1,f=3,q=2,rwp=40003}),i(2458,{f=55,lvl=2,q=1,rwp=40003}),i(2459,{f=55,lvl=5,q=1,rwp=40003})}}),q(479,{coords={{44,41,1421}},lvl=10,qgs={2121},r=1,rwp=40003,sourceQuests={482},g={qo(1,{crs={1912,1914,1915},providers={{"i",3354}},rwp=40003})}}),q(422,{coords={{44.2,39.8,1421}},lvl=9,qgs={1938},r=1,rwp=40003,sourceQuests={421},g={